import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';
import Navbar from './components/navbar';
import { Provider } from 'redux'
import Store from "./store"

function App() {
  return (
    <div className="App">
      <Provider store={Store}>
        <Navbar/>
        <h1>Hello World!</h1>
      </Provider>
    </div>
  );
}

export default App;
